import React, { useState } from "react";
import { Box } from "@mui/system";
import Paper from "@mui/material/Paper";

function UserList() {
  return (
    <Box
      sx={{
        width: 500,
        maxWidth: "100%",
        bgcolor: "white",
        borderRadius: "",
        display: "flex",
        flexWrap: "wrap",
        "& > :not(style)": {
          m: 1,
          width: 128,
          height: 128,
        },
      }}
      position="relative"
      bottom="2rem"
      left="40rem"
    >
      <Paper />
    </Box>
  );
}

export default UserList;
